import React from "react";

import BlockContentTable from "./BlockContentTable";

import Divider from "@material-ui/core/Divider";
import Typography from "@material-ui/core/Typography";
import CheckIcon from "@material-ui/icons/Check";
import IconButton from "@material-ui/core/IconButton";
import { makeStyles } from "@material-ui/core/styles";
import { blue, green } from "@material-ui/core/colors";

const useStyles = makeStyles({
  mainTitle: {
    fontWeight: "bold",
    paddingBottom: "40px",
  },
  title: {
    fontSize: 18,
    paddingBottom: "15px",
    fontWeight: "bold",
  },
  icon: {
    backgroundColor: blue,
  },
});

const Home = () => {
  const classes = useStyles();

  return (
    <div>
      <Typography variant="h6" className={classes.mainTitle} gutterButtom>
        THIS IS THE PERSONAL CONTRACT VIEW
      </Typography>
      <Typography variant="h6" className={classes.title} gutterButtom>
        THESE ARE THE BINARY CONTRACTS
      </Typography>
      <BlockContentTable />
      <Divider />
      <IconButton color="secondary" aria-label="add an alarm">
        <CheckIcon style={{ color: "snow", backgroundColor: green[500] }} />
      </IconButton>
      <Typography variant="h6" className={classes.title} gutterButtom>
        THESE ARE YOUR REQUESTS
      </Typography>
      <BlockContentTable />
    </div>
  );
};

export default Home;
